package com.zhoukaifan.ddddemo.external.vo;

public class ExternalItem {
    private Long id;
    private String name;
    private Integer unitPrice;
    private Integer fff;
    private Integer sss;
    private Integer aaa;
    private Integer dffd;
    private Integer ssa;

    public Long getId() {
        return id;
    }

    public void setId(Long id) {
        this.id = id;
    }

    public String getName() {
        return name;
    }

    public void setName(String name) {
        this.name = name;
    }

    public Integer getUnitPrice() {
        return unitPrice;
    }

    public void setUnitPrice(Integer unitPrice) {
        this.unitPrice = unitPrice;
    }

    public Integer getFff() {
        return fff;
    }

    public void setFff(Integer fff) {
        this.fff = fff;
    }

    public Integer getSss() {
        return sss;
    }

    public void setSss(Integer sss) {
        this.sss = sss;
    }

    public Integer getAaa() {
        return aaa;
    }

    public void setAaa(Integer aaa) {
        this.aaa = aaa;
    }

    public Integer getDffd() {
        return dffd;
    }

    public void setDffd(Integer dffd) {
        this.dffd = dffd;
    }

    public Integer getSsa() {
        return ssa;
    }

    public void setSsa(Integer ssa) {
        this.ssa = ssa;
    }
}
